import MyNavbar from "../../components/Navbar/Navbar";
import { Navigate} from "react-router-dom";
import "./Panel.css";
function Panel() {
  const isLogin=(username)=>{
    if(username=='admin')return true
    return false
  }
  return (
    <>
    {isLogin('admin')?(
    <div>
       <MyNavbar />
      <h1>Panel page</h1>
    </div>
   
    ):
    (
      <Navigate to={'/'}/>
    )}
    </>
  );
}
export default Panel;
